import React, { useState } from 'react';
import { MOCK_BATCH_RESULTS, MOCK_BATCH_SUMMARY } from '../data/mockData';

const BatchProcessing = () => {
  const [loading, setLoading] = useState(false);
  const [fileName, setFileName] = useState('Choose CSV file...');
  const [results, setResults] = useState(null);
  const [summary, setSummary] = useState(null);

  const handleUpload = () => {
    if (fileName === 'Choose CSV file...') {
      alert('Please select a CSV file.');
      return;
    }

    setLoading(true);
    setResults(null);
    setSummary(null);

    // Simulate batch processing delay
    setTimeout(() => {
      setResults(MOCK_BATCH_RESULTS);
      setSummary(MOCK_BATCH_SUMMARY);
      setLoading(false);
    }, 3000);
  };

  const handleFileClick = () => {
    // Simulate file selection
    setFileName('job_descriptions_sample.csv');
  };

  const handleDownload = () => {
    // Simulate download functionality
    const csvContent = "data:text/csv;charset=utf-8," + 
      "Row,Job Title,Predicted Category,Skills Found,Extracted Skills\n" +
      results.map((row, index) => 
        `${index + 1},"${row.title}","${row.predicted_category}",${row.skills_found},"${row.skills}"`
      ).join("\n");

    const encodedUri = encodeURI(csvContent);
    const link = document.createElement("a");
    link.setAttribute("href", encodedUri);
    link.setAttribute("download", "analysis_results.csv");
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
  };

  return (
    <div className="card">
      <h2 className="text-2xl font-bold text-gray-900 mb-6">Batch Processing</h2>
      <p className="text-gray-600 mb-6">
        Upload a CSV file with columns: <strong>title</strong> and <strong>skillset</strong> (or alternative names: job_title, description, skill_set)
      </p>

      <div className="space-y-4 mb-6">
        <div 
          onClick={handleFileClick}
          className="file-upload"
        >
          <span className="text-gray-700">{fileName}</span>
          <button className="btn btn-primary">
            Browse Files
          </button>
        </div>

        <button
          onClick={handleUpload}
          disabled={loading}
          className={`btn btn-primary ${loading ? 'opacity-60 cursor-not-allowed' : ''}`}
          style={{ width: '100%' }}
        >
          {loading ? (
            <div className="flex items-center justify-center">
              <div className="spinner animate-spin mr-2"></div>
              Processing Files...
            </div>
          ) : (
            'Upload and Analyze'
          )}
        </button>
      </div>

      {summary && (
        <div className="rounded-lg p-6 mb-6 border border-blue-200" 
             style={{ background: 'linear-gradient(to right, #eff6ff, #f0fdf4)' }}>
          <h3 className="text-lg font-semibold text-gray-900 mb-4">Processing Summary</h3>
          <div className="grid grid-cols-2 md-grid-cols-4" style={{ gap: '1rem' }}>
            <div className="text-center">
              <div className="text-3xl font-bold text-green-600">{summary.total_jobs}</div>
              <div className="text-sm text-gray-600">Total Jobs</div>
            </div>
            <div className="text-center">
              <div className="text-3xl font-bold" style={{ color: '#2563eb' }}>{summary.categories_found}</div>
              <div className="text-sm text-gray-600">Categories Found</div>
            </div>
            <div className="text-center">
              <div className="bg-green-50 text-green-800 px-2 py-1 rounded-full text-sm font-semibold" 
                   style={{ display: 'inline-block' }}>
                {summary.model_mode}
              </div>
              <div className="text-sm text-gray-600 mt-1">Model Mode</div>
            </div>
            <div className="text-center">
              <div className="bg-blue-50 px-2 py-1 rounded-full text-sm font-semibold" 
                   style={{ display: 'inline-block', color: '#1e40af' }}>
                {summary.extractor_mode}
              </div>
              <div className="text-sm text-gray-600 mt-1">Extractor Mode</div>
            </div>
          </div>
        </div>
      )}

      {results && (
        <div>
          <div className="flex justify-between items-center mb-4">
            <h3 className="text-lg font-semibold text-gray-900">
              Analysis Results ({results.length} jobs)
            </h3>
            <button
              onClick={handleDownload}
              className="btn btn-secondary"
            >
              Download Results
            </button>
          </div>

          <div style={{ overflowX: 'auto', borderRadius: '8px', border: '1px solid #e5e7eb' }}>
            <table className="table">
              <thead>
                <tr>
                  <th>#</th>
                  <th>Job Title</th>
                  <th>Category</th>
                  <th>Skills</th>
                  <th>Extracted Skills</th>
                </tr>
              </thead>
              <tbody>
                {results.map((row, index) => (
                  <tr key={index}>
                    <td style={{ fontWeight: '500' }}>
                      {index + 1}
                    </td>
                    <td style={{ fontWeight: '500' }}>
                      {row.title}
                    </td>
                    <td>
                      <span className="skill-tag" style={{ backgroundColor: '#dcfce7', color: '#166534' }}>
                        {row.predicted_category}
                      </span>
                    </td>
                    <td className="text-center font-bold text-green-600">
                      {row.skills_found}
                    </td>
                    <td style={{ maxWidth: '20rem', overflow: 'hidden', textOverflow: 'ellipsis', whiteSpace: 'nowrap' }} 
                        title={row.skills}>
                      {row.skills}
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      )}
    </div>
  );
};

export default BatchProcessing;
